Server hard restarted - mission updated to 2.1.2
Also:
We don't have to set the parameters anymore - I implemented some new code in the server.cfg which automatically sets the correct parameters which need to be changed elseways after a hard restart.
```sqf
// MISSIONS CYCLE (see below)
class Missions {
class Mission1    {
    template ="A3-Antistasi-2_1_2-WotP.tanoa";
        difficulty = "Custom";
            class Params {
            switchComm = 0;
            pMarkers = 0;
            AISkill = 2;
            unlockItem = 40;
            memberOnlyMagLimit = 60;
            teamSwitchDelay = 1800;
        };
};
};```
